import React, { useEffect, useState } from 'react';
import axios from 'axios';
import moment from 'moment';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [userData, setUserData] = useState(null);
  const [miningMsg, setMiningMsg] = useState('');
  const [boostPopup, setBoostPopup] = useState(false);
  const [countdown, setCountdown] = useState('');
  const token = localStorage.getItem('token');
  const navigate = useNavigate();

  const headers = {
    'Content-Type': 'application/json',
    'Authorization': `Bearer ${token}`
  };

  const fetchUser = async () => {
    try {
      const res = await axios.get('https://profitpilot-backend.onrender.com/api/users/profile', { headers });
      setUserData(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleMine = async () => {
    try {
      const res = await axios.post('https://profitpilot-backend.onrender.com/api/users/mine', {}, { headers });
      setMiningMsg(res.data.msg);
      fetchUser();
    } catch (err) {
      setMiningMsg(err.response?.data?.msg || 'Error mining');
    }
  };

  const handleBoost = async () => {
    try {
      const res = await axios.post('https://profitpilot-backend.onrender.com/api/users/boost', {}, { headers });
      alert(res.data.msg);
      setBoostPopup(false);
      fetchUser();
    } catch (err) {
      alert(err.response?.data?.msg || 'Boost failed');
    }
  };

  const calculateCountdown = () => {
    const start = moment('2025-06-06');
    const end = moment(start).add(6, 'months');
    const now = moment();
    const diff = end.diff(now);
    if (diff <= 0) return 'Withdraw available soon.';
    const duration = moment.duration(diff);
    return `${duration.months()}m ${duration.days()}d ${duration.hours()}h`;
  };

  useEffect(() => {
    fetchUser();
    setCountdown(calculateCountdown());
    const interval = setInterval(() => {
      setCountdown(calculateCountdown());
    }, 1000 * 60);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="min-h-screen bg-black text-white p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-3xl font-bold text-yellow-400">ProfitPilot Dashboard</h1>
        <div className="space-x-4">
          <button onClick={() => navigate('/referral')} className="text-sm text-yellow-400 hover:underline">Referrals</button>
          <button onClick={() => navigate('/leaderboard')} className="text-sm text-yellow-400 hover:underline">Leaderboard</button>
          <button onClick={() => navigate('/token')} className="text-sm text-yellow-400 hover:underline">Create Token</button>
        </div>
      </div>

      {userData && (
        <div className="grid md:grid-cols-2 gap-6">
          <div className="bg-zinc-900 rounded-xl p-6 shadow-lg space-y-3">
            <h2 className="text-xl font-semibold">Your Stats</h2>
            <p><strong>Balance:</strong> ${userData.income.toFixed(2)}</p>
            <p><strong>Boost Rate:</strong> x{userData.boostRate}</p>
            <p><strong>Countdown:</strong> {countdown}</p>
            <p><strong>Tokens:</strong> {userData.tokens.length}</p>
            <button
              onClick={handleMine}
              className="w-full mt-3 bg-yellow-500 hover:bg-yellow-600 transition-all py-2 rounded-lg font-semibold"
            >
              Start Mining
            </button>
            {miningMsg && <p className="text-green-400 text-sm mt-2">{miningMsg}</p>}
          </div>

          <div className="bg-zinc-900 rounded-xl p-6 shadow-lg space-y-3">
            <h2 className="text-xl font-semibold">Performance Chart</h2>
            <div className="h-40 bg-gray-800 rounded-md flex items-center justify-center">
              <p className="text-gray-400">[Chart Coming Soon]</p>
            </div>
            <button
              onClick={() => setBoostPopup(true)}
              className="w-full bg-yellow-500 hover:bg-yellow-600 transition-all py-2 rounded-lg font-semibold"
            >
              Boost
            </button>
          </div>
        </div>
      )}

      {boostPopup && (
        <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-70 z-50">
          <div className="bg-zinc-900 p-6 rounded-2xl shadow-xl w-[90%] max-w-sm text-center">
            <h3 className="text-xl font-bold text-yellow-400 mb-2">Confirm Boost</h3>
            <p className="text-gray-300 mb-4">Simulate $3 boost to double your mining earnings?</p>
            <div className="flex justify-between space-x-4">
              <button
                onClick={handleBoost}
                className="flex-1 bg-yellow-500 hover:bg-yellow-600 transition-all py-2 rounded-lg font-semibold"
              >
                Confirm
              </button>
              <button
                onClick={() => setBoostPopup(false)}
                className="flex-1 bg-gray-700 hover:bg-gray-600 transition-all py-2 rounded-lg"
              >
                Cancel
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
